INSERT INTO `abouts` (`id`, `title`, `content`, `image`, `created_at`, `updated_at`) VALUES
(3, 'About', '<p>Dohmayn is a game-changing platform designed to make property investment accessible, transparent, and secure for everyone.&nbsp;</p>\r\n<p>Our core value is serving as a redress scheme between the real estate company and the consumers. A redress scheme is an independent organization that works to resolve disputes between Real Estate Company and the consumers.</p>\r\n<p>Powering the future of property investment: We leverage blockchain-inspired technology, to provide: Real-time dynamic valuation updates, ensuring that our customers always have a clear view of their investments&rsquo; growth and market value, And a user-friendly interface, enabling users to make informed decisions confidently.&nbsp; &nbsp;</p>', 'assets/images/about/1750377268.jpg', '2024-11-15 11:10:31', '2025-06-20 03:54:28');
