INSERT INTO `faqs` (`id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(1, 'How does the dynamic property valuation feature work?', 'The platform tracks real-time market data and valuation trends to update property prices dynamically, providing you with accurate insights into your investments.', '2024-11-15 12:21:32', '2024-11-17 23:46:41'),
(2, 'How do I buy a property or land segment?', 'Simply browse available properties, choose the one you’re interested in, and complete the transaction using our secure payment gateway.', '2024-11-15 12:26:55', '2024-11-17 23:47:10'),
(4, 'What documents do I receive after purchasing a property?', 'You will receive legal ownership documents, including titles, land surveys, and other relevant paperwork, which will be accessible from your user dashboard.', '2024-11-17 23:49:02', '2024-11-17 23:49:02'),
(5, 'What happens after I purchase a property?', 'Once your payment is processed, ownership will be updated, and you can view the property details, valuation history, and legal documents in your dashboard.', '2024-11-17 23:49:37', '2024-11-17 23:49:37'),
(7, 'Is there a service fee for selling properties?', 'Yes, a small service fee is deducted from the sale proceeds. The fee details will be displayed before you confirm the listing.', '2024-11-17 23:50:50', '2024-11-17 23:50:50'),
(9, 'How do I track my investment\'s performance?', 'Use the valuation tracking feature in your dashboard to monitor the property\'s current market value, historical data, and price predictions.', '2024-11-17 23:51:36', '2024-11-17 23:51:36'),
(11, 'How can a first time investor get started with property ownership on your platform?', 'Register, choose any property share, invest and track your asset growth in real-time', '2025-02-13 21:00:55', '2025-02-13 21:00:55'),
(12, 'How does blockchain-inspired technology enhances security and transparency?', 'It ensures secured, tamper-proof transactions, real-time updates, and transparent ownership verification.', '2025-02-13 21:03:42', '2025-02-13 21:03:42'),
(13, 'What are the benefits of investing in a digital real estate assets?', 'Secured transactions, lower costs, real-time valuation updates and tracking, easy management and wealth building opportunities.', '2025-02-13 21:15:22', '2025-02-13 21:15:22');
