INSERT INTO `posts` (`id`, `title`, `slug`, `content`, `image`, `created_at`, `updated_at`) VALUES
(2, 'Revolutionizing Real Estate Investment with Hamuj Real Estate upp', 'revolutionizing-real-estate-lnvestment-with-hamuj-rea-estate-upp', '<p>The world of real estate is evolving, and Hamuj Real Estate is at the forefront of this transformation. In a market where high costs and complex processes often deter potential investors, our platform upp</p>', 'assets/images/post/1731698783.png', '2024-11-15 18:26:23', '2024-11-15 18:51:19'),
(3, 'Breaking Barriers with Fractional Ownership', 'breaking-barriers', '<p>Traditional property ownership has long been reserved for those with significant capital. Hamuj Real Estate changes this narrative by introducing fractional ownership, allowing investors to purchase smaller, affordable land segments. This approach not only makes property investment accessible to a wider audience but also opens doors to high-potential assets that may have previously been out of reach.</p>', 'assets/images/post/1731698812.png', '2024-11-15 18:26:52', '2024-11-15 18:26:52'),
(4, 'Leveraging Technology for Transparency and Growth', 'leveraging-technology', '<p>At the heart of our platform is blockchain-inspired technology, designed to ensure transparency and security. Real-time valuation updates provide users with a dynamic view of their investments&rsquo; performance, enabling informed decision-making. Every transaction, from purchase to ownership transfer, is secure, traceable, and seamless.</p>', 'assets/images/post/1731699070.png', '2024-11-15 18:31:10', '2024-11-15 18:31:10'),
(5, 'Empowering Investors with a User-Friendly Experience', 'empowering-investors', '<p>Hamuj Real Estate prioritizes simplicity and inclusivity. From browsing properties to purchasing a segment, every step is designed to be intuitive and efficient. Our platform fosters trust by offering verified documentation, valuation tracking, and secure payment options, ensuring that every user feels confident in their investment journey.</p>', 'assets/images/post/1731699525.png', '2024-11-15 18:38:45', '2024-11-15 18:38:45'),
(6, 'Shaping the Future of Real Estate nn', 'shaping-the-future', '<p>With a vision to make property ownership inclusive, Hamuj Real Estate is setting a new standard in real estate investment. By combining traditional principles with modern technology, we&rsquo;re not just transforming how people invest&mdash;we&rsquo;re redefining what&rsquo;s possible in the world of real estate.</p>\r\n<p>Join us in revolutionizing property investment and explore the future with Hamuj Real Estate. vppp</p>', 'assets/images/post/1731700403.png', '2024-11-15 18:39:37', '2024-11-15 18:53:23');
INSERT INTO `privacies` (`id`, `content`, `created_at`, `updated_at`) VALUES
(1, '<p><strong><span style=\"text-decoration: underline;\">Privacy Policy</span></strong><br />Consumer Privacy Policy Highlights.<br />Protecting your privacy is important to us. We want to be open with you on how and why we use your personal information.</p>\r\n<p>Below are some key highlights of our privacy policy:<br />1. Who we are.<br />2. What is Personal Information?<br />3. Sources of personal data.<br />4. What do we collect and why we want to use?<br />5. What we collect.<br />6. Why do we collect and use my email?<br />7. How do we share your personal information?<br />8. Purpose and lawful basis.<br />9. How long we keep your data for.<br />10. Change of Purpose.<br />11. Where do we store your personal information?<br />12. Access to your personal information&nbsp;<br />13. What happen to your personal information when you leave<span style=\"text-decoration: underline;\"> Dohmayn</span>?<br />14. Change to this policy.<br />15. Contact us.</p>\r\n<p>Note that continued usage of this platform indicates that you understand this privacy policy and accept all the terms in it.<br /><br /></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>THE FULL POLICY</strong></span><br />This Privacy Policy describes our policies and procedures on the collection, use and disclosure of your information when you use the services and tells you about your privacy rights and how the law protects you. If you do not agree with our policies and practices, you may choose to not use our Service. This policy may change from time to time (Refer to &lsquo;Changes to this Privacy Policy&rsquo;).</p>\r\n<p>We use your Personal data to provide and improve the Service. By accessing or using the Service, you agree to the collection and use of information in accordance with this Privacy Policy.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Definitions</strong></span></p>\r\n<p>For the purposes of this Privacy Policy:<br />&lsquo;<strong>Account&rsquo;</strong> means a unique account created by you to access our Service or parts of our Service.</p>\r\n<p>&lsquo;<strong>Application</strong>&rsquo; means the software program provided by the Company downloaded by You on any electronic device, named <strong>Dohmayn.</strong></p>\r\n<p>&lsquo;<strong>Company&rsquo;</strong> (referred to as either &ldquo;the Company&rdquo;, &ldquo;We&rdquo;, &ldquo;Us&rdquo; or &ldquo;Our&rdquo; in this Agreement) refers to DOHMAYN TECHNOLOGIES LIMITED.(8235147)</p>\r\n<p>&lsquo;<strong>Cookies&rsquo;</strong> are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.</p>\r\n<p>&lsquo;<strong>Device&rsquo; </strong>means any device that can access the Service such as a computer, a cell phone or a digital tablet.</p>\r\n<p><strong>&lsquo;Personal Data</strong>&rsquo; is any information that relates to an identified or identifiable individual.</p>\r\n<p>&lsquo;<strong>Service&rsquo; </strong>refers to the Application or the Website or both.</p>\r\n<p>&lsquo;<strong>Service Provider&rsquo;</strong> means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.</p>\r\n<p>&lsquo;<strong>Third-party Social Media Service</strong>&rsquo; refers to any website or any social network website through which a User can log in or create an account to use the Service.</p>\r\n<p>&lsquo;<strong>Usage Data&rsquo;</strong> refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</p>\r\n<p><strong>&lsquo;Website&rsquo;</strong> refers to Dohmayn, accessible from https://www.dohmayn.com</p>\r\n<p>&lsquo;<strong>You&rsquo;</strong> means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</p>\r\n<p><br /><span style=\"text-decoration: underline;\"><strong>Who we are</strong></span><br />This privacy policy covers Dohmayn platform. Our Platform is for listing of Properties for purchase, sale, transfer and real valuation purposes.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>What is Personal Information?</strong></span><br />\"Personal Information\" is any information that can identify you. This may include, but is not limited to, your name, mailing address, telephone number, email address, Internet Protocol (&ldquo;IP&rdquo;) address, age, gender, marital status, health information, financial status, credit card information and credit history.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Sources of personal data</strong></span><br />We process personal data that we receive from:</p>\r\n<p>1. You: when you get in touch with us, create and use your Dohmayn Account, make use of our websites and services, enquire about a property or request a valuation, or apply for a job with us.<br />2. Our members (Real estate company&rsquo;s and Real Estate developer&rsquo;s): when we advertise their properties on our sites or needs to conduct their business checks.<br />3. Third parties: land registry, OSSG<br />4. Public available sources such as CAC and other public search sites.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">When do we collect your data?</span></strong><br />If you are just browsing our Site/Application, we don&rsquo;t collect any Personal Information about you except you fill our online form for notifications. However, we will request/collect your data when you create an account on our platform.&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>What do we collect and why do we collect these information?</strong></span><br />We collect information that is necessary for the use of our Services, such as your username, email address, date of birth, and password. If you register on our platform via third parties like Facebook and Google, they send us information that is necessary for your use of our Services, such as your name, email address, gender and birthdate. We also automatically collect information from your use of our Services, including IP address, Cookie data, Device information, Browser type, operating systems, Pages previously visited etc. We collect this information for the purpose of accepting the creation of account on our platforms and to send necessary notifications to you.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Why do we collect and use my email?</span></strong><br />We use email as an important way to communicate with you. You can manage your email notification preferences, such as messages and follower alerts, by adjusting your preferences in the notifications section of your account Settings. You may also opt out or unsubscribe from any future email communications from within a link provided in each email we send you. However, please note that in all cases you will continue to receive all system e-mails (e.g. those regarding forgotten user passwords) and legal notices (e.g. updates to our policies) from us.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">How do we share your personal information?</span></strong><br />We may share your Personal Information with third-party service providers, but only where it&rsquo;s necessary to provide any of the Services to you (e.g., email providers, server providers, etc.). When we share data with third-party services that support our delivery of the Services, we require and ensure that they protect your Personal Information to the same standards we do.</p>\r\n<p>We do not and will not release, rent or sell your Personal Information, except in the following very limited situations:</p>\r\n<p>1. To comply with an applicable law (including investigations of any crime), regulation, legal process or enforceable governmental request;<br />2. To enforce or apply our Terms of Use and other policies, including investigation of potential violations;<br />3. To protect the rights, property, or safety of Dohmayn, our employees, our users, or the public;</p>\r\n<p>If Dohmayn is involved in a merger, acquisition or asset sale, in which case we will continue to ensure the confidentiality of any Personal Information and give affected users notice before Personal Information is transferred or becomes subject to a different privacy policy.<br />We will never post anything to your Facebook or other third-party accounts without your permission.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Purpose and lawful basis</strong></span><br />We rely on a mixture of performance of contract, legitimate interests, consent and legal obligations to process your personal data in order to:</p>\r\n<p>1. Advertise properties on our sites.<br />2. Build property databases, valuation and surveyor tools.<br />3. Provide current and historical market and property trends.<br />4. Provide services such as:</p>\r\n<p>4.1. Enabling you to get all information about properties and track dynamic property valuations over time<br />4.2. Resolve any queries or complaints you may have<br />4.3. Customize and enrich your experience on our sites.<br />4.4. Process your job application and consider you for our vacancies.<br />4.5. Help keep our site safe and secure.<br />4.6. Improve our site and services and to help trouble shoot.<br />4.7. Monitor for quality assurance and internal training.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>How long we keep your data for</strong></span><br />We will only retain your personal information for as long as necessary to fulfil the purposes we collected it for, including for any legal, accounting, or reporting requirements. To determine the appropriate retention period for personal information so that it can no longer be associated with you.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Change of Purpose</strong></span><br />We will only use your personal information for the purposes for which we collected it, unless we reasonably consider that we need to use it for another reason and that reason is compatible with the original purpose. If you wish to get an explanation as to how the processing for new purpose is compatible with the original purpose, please contact us. If we need to use your personal information for an unrelated purpose, we will notify you and we will explain the legal basis which allows us to do so. Please note that we may process your personal information without your knowledge or consent, in compliance with the above rules, where this required or permitted by law.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Where do we store your personal information?</strong></span><br />&nbsp;However, Personal Information that you submit through the Services may be transferred to countries other than where you reside for processing and storage. In addition, our third party service providers also may process or store your Personal Information on servers outside your country, including but not limited to the UK or the US.<br />By using any of the Services, or submitting any Personal Information via the Services, you authorize Dohmayn and its authorized service providers to use and process your Personal Information in these countries. Please be aware that the privacy protections and the rights of authorities and Government agencies to access your personal information in some of these countries may not be equivalent to those in your country.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Access to your personal information&nbsp;</strong></span><br />If you wish to access any Personal Information that we hold about you, or request that we correct or delete the Personal Information that we hold about you, you may contact us via email at customersupport@dohmayn.com. We will comply with such requests to the extent required by law or our policies, and subject to any limitations in our systems.<br />To access, modify or delete the Personal Information you have provided to us, please log in and update your profile.<br /><span style=\"text-decoration: underline;\"><strong>How does Dohmayn protect my personal information?</strong></span><br />We are continuously implementing and updating physical, organizational, contractual and technological security measures to protect your Personal Information from loss, theft, unauthorized access, disclosure, copying, use or modification. They only employees who are granted access to your Personal Information are those with a business &ldquo;need-to-know&rdquo; or whose duties reasonably require such information. On all Dohmayn platforms, we support encryption on all transmissions to protect Personal Information submitted on our Site.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>What happen to your personal information when you leave Dohmayn?</strong></span><br />If you close your account, it will first be deactivated for a period of six months. For six months after deactivation, it is still possible to restore your account if it was accidentally or wrongfully deactivated, including re-associating your comments and contributions to your profile. After six months, we permanently delete your Personal Information from our systems, except that your anonymized comments and contributions will remain on the Service.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Change to this policy</strong></span></p>\r\n<p>We may change the terms of this policy at any time. This may be as a result of administrative activities or required by new and existing regulations. Any changes we may make to this policy in the future will be posted on our platforms and displayed on screen when you use Our App.<br />You may be required to read and accept any revised Policy to continue your use of our Platforms. The amended terms will be made available with new uploads or updates of the App and will be displayed in the Privacy Policy section of the App.</p>\r\n<p>Please check back frequently to see any updates or changes to this policy, as you will be deemed to accept such changes from your continued use of our platforms.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Contact us</strong></span><br />If you have any questions about this policy, how &nbsp;we use your personal data, wish to exercise any of your rights, or want to report a suspected breach of your personal data, please contact us at <span style=\"text-decoration: underline;\">customersupport@dohmayn.com.</span></p>\r\n<p><strong>Issue and effective date: 1st June 2025</strong></p>', '2024-11-23 16:20:35', '2025-06-20 13:32:44');
