(1, 'Cedar Luxury Estate', 'cedar-luxury-estate', '<p>Dohmayn is proud to present freehold land located on Hon. Naheem Adams Street, Ogombo Road, Abraham Adesanya, Ajah, Lagos State, Nigeria.</p>\r\n<p>Cedar Luxury Estate offers a perfect blend of tranquility and convenience, situated just one mile from Charter House British School and providing easy access to the Lekki-Epe Expressway.</p>\r\n<p>Dream big with premium land available at 1,230.262 square meter, waiting to be transformed into your ideal home. Build your future in style!</p>\r\n<p>With a touch of creativity, this exceptional property can become a stunning masterpiece, a rare gem in the market. Secure your slice of luxury in this prime location today!</p>\r\n<p>Please note that physical allocation will occur with purchases of 250 square meters or more.</p>', 'Hon. Naheem Adams Street, Ogombo Road, Abraham Adesanya', 'Ajah', 'Nigeria', '69448.82', 69448.82, 0, '1230', 'Lagos', '1229', '73/73/1996, Source (OSSG Lagos state)', 'Freehold', 'assets/images/property/1731843706_IMG_3459 (1).png', 'assets/images/property/1731795234_featured-grid2.jpg', 'assets/images/property/1731795234_featured-grid3.jpg', 'assets/images/property/1748770003_IMG-20250219-WA0060.jpg', 'assets/images/property/1748770003_WhatsApp Image 2025-06-01 at 10.20.27.jpeg', 'https://www.youtube.com/', 'https://maps.app.goo.gl/6hcwo39FrNT9y3MQ6?g_st=iw', '2025', 'available', NULL, '2024-11-16 21:13:54', '2025-06-13 22:43:49', NULL);
