(1, '<p><span style=\"text-decoration: underline;\"><strong>Website terms of use</strong></span>&nbsp;<br />Please read these terms and conditions carefully and click on the accept button before using this site as they are a legally binding agreement between you and us.</p>\r\n<p><strong>What&rsquo;s in these terms?</strong><br />These terms tell you rules for using our domain (dohmayn.com) including our website(dohmayn), as well as any sub-domain or sibling-domain registered to Dohmayn and any uniform resource locator (URL) or Application Programming Interface (API) by which Dohmayn&rsquo;s data may be accessed (reffered to as site&rdquo;). Throughout this document we refer to them as the &ldquo;Term&rdquo;. A reference to &ldquo;you&rdquo; or &ldquo;your&rdquo; is a reference to the user to the site.</p>\r\n<p><strong>1. Who we are and how to contact us&nbsp;</strong></p>\r\n<p><strong>1.1.</strong>&nbsp; We are DOHMAYN TECHNOLOGIES LIMITED (RC 8235147). We built a trust platform called Dohmayn. Dohmayn is a property platform focused on making property investment accessible, transparent, and scalable, it allows users to explore, buy, sell and manage fractional property ownership in a tech-driven. We are provider of the site. Dohmayn will be serving as a redress scheme between the real estate company and the consumers. A redress scheme is an independent organization that works to resolve disputes between real estate company and the consumers.&nbsp;<br />1.2.&nbsp; To contact us, please email customersupport@dohmayn.com.</p>\r\n<p><strong>2.</strong><strong>&nbsp;By using our site, you accept these terms</strong><br />1.1. These Terms set out all of the rules and obligations that apply to your use of the site.<br />2.2. By using our Site, you confirm that you accept these Terms and that you agree to comply with them. If you do not agree to these Terms, you must not use our site.<br />2.3.We recommend that you download and store a copy of these Terms for future reference. They are a legally binding agreement between you and us<br />2.4. These Terms may also make reference to other terms that apply when using our site, such as our Privacy policy and Cookie Policy.</p>\r\n<p><strong>3. We may make changes to our terms</strong><br />3.1. We amend these Terms from time to time by updating them on the Site. Every time you wish to use our Site, please check these Terms to ensure you understand the Terms that apply at that time.</p>\r\n<p><strong>4. We may make changes to our site</strong><br />4.1. We may from time to time change the content of this site or suspend or discontinue any aspect of this Site, which may include your access to it.</p>\r\n<p><strong>5. Your obligation and acceptable use</strong></p>\r\n<p>5.1. You accept that you are solely responsible for ensuring that your computer system meets all relevant technical specification necessary to use this site/app and that your computer system is compatible with this Site/app.<br />5.2. You must not misuse our system or this site. In particular, you must not hack into, circumvent security or otherwise disrupt the operation of our system and this site, or attempt to carry out any of the foregoing. This includes introducing viruses, Trojans, worms, logic bombs or other material which is or could be malicious or technologically harmful. You must not misuse any forms on the Site and any forms you submit must be a genuine enquiry.<br />5.3. You must not use or attempt to use any automated program (including, without limitation, any spider or other web crawler) to access our system or this site by means of any such automated programs is strictly unauthorized.<br />5.4. You must not upload or use inappropriate or offensive language or content or solicit any commercial services in any communication, form or email you send or submit, from or to the Site.<br />5.5. Unless you have our prior written consent from our Legal team, you must not do or attempt to do any of the following:</p>\r\n<p style=\"text-align: justify;\">&nbsp; &nbsp; &nbsp; 5.5.1. Access this Site in order to obtain property information available from it other than by means of direct human interaction with its human-readable web pages by using either (a) a web browser which is directly accessing this Site or (b) a mobile app or other computer program published by us.<br />&nbsp; &nbsp; &nbsp; &nbsp;5.5.2. Use technical means to access this Site which enables, causes or facilitates you or others to access this Site in a manner prohibited by clause 5.5.1.<br />&nbsp; &nbsp; &nbsp;5.5.3. In a particular and without limitation, unless you or others have our prior written consent you or others may not extract or seek to extract property information from site other than by means of direct human interaction with the menu system, hyperlinks and search and filters functions displayed on the human-readable pages of this Site by using either (a) a web browser which is directly accessing this Site or (b) a mobile app or other computer program.</p>\r\n<p><strong>6.&nbsp; Interactive services and content</strong><br />6.1. When you fill out and submit an enquiry form on our site, your personal information will be processed in accordance with our Privacy Policy.<br />6.2.&nbsp; Enquiry forms on our site should only be used for the purpose for which they are intended. If we (in our reasonable opinion and at our sole discretion) suspect a form have been misused, irrespective of whether the misuse is a result of recklessness or negligence as to the proper use of that form to the intended recipient(s) without notice to you.</p>\r\n<p><strong>7. Registration</strong>&nbsp;<br />7.1. To gain access to certain details and services on our site you will need to register (free of charge) as a Dohmayn user. If we accept your application for registration, you will be given access at the point of application.<br />7.2.&nbsp; Each registration is for a single user only. You must not share your username and password with any other person or with multiple users on a network.</p>\r\n<p>7.3. You must ensure the password you use is unique and not be re-used anywhere else such as other websites, portals, or any other accounts.<br />7.4. You undertake that all information provided by you for the purposes of registering with us is accurate and complete.<br />7.5. You accept sole responsibility for all use of and for keeping secret any password that may have been given to you or chosen by you for use on this site. You will notify us immediately of any unauthorized use of them or any other breach of security of this site of which you become aware.<br />7.6. We have the right to disable any account or password, whether chosen by you or allocated by us, any time, it in our reasonable opinion you have failed to comply with any of the provision of these Terms.</p>\r\n<p><strong>8. Intellectual property</strong><br />&nbsp;8.1. The copyright and all other intellectual property rights in this site (including all database rights, trademarks, service marks, trading names, text, graphics, code, files, links and other materials published on it) belong to us at Dohmayn Technologies Limited or our licensor(s). All rights are reserved.<br />&nbsp;8.2. Our registered trademarks include the following devices and word marks: you must not use or copy them without our prior written consent.</p>\r\n<p><strong>9. Warranty&nbsp;</strong><br />9.1. Whilst we endeavor to ensure that any material available for downloading from this site (such as property brochure) is not contaminated in any way, we do not warrant that such material will be free from infection, viruses and/or similar code.<br />9.2.&nbsp; Due to the nature of software and internet, we do not warrant that your access to, or the running of, this site will be uninterrupted or error free. We may suspend, withdraw, discontinue or change all or any part of our site with notice. We shall not be liable if we cannot process your details due to circumstance beyond our reasonable control.</p>\r\n<p><strong>10. Customer feedback and quality</strong><br />10.1. We try to ensure that all customer feedback is dealt with fairly and consistently, and is properly recorded. We welcome any suggestions that you make about how we may improve our services. Please write to us at Customer Services, <strong>DOHMAYN TECHNOLOGIES LIMITED</strong>, using the email provided at the beginning of these Terms or via the Contact Us section on our site. We aim to acknowledge all customer feedback. &nbsp;</p>\r\n<p><strong>11. General provisions</strong><br />11.1. The headings in these Terms of use are solely used for convenience only.<br />11.2. You may not assign or delegate any or all of your rights or obligations in these Terms of use.<br />11.3.&nbsp; We may assign this agreement at any time without notice to you.<br />11.4. Our delay or failure to exercise or enforce any right or provision of these Terms of use shall not constitute or be construed as a waiver of such right to act.</p>\r\n<p>Thank you for visiting Dohmayn. &nbsp;<strong>Issue and effective</strong> date is 1st June 2025.</p>', '2024-11-23 11:04:06', '2025-05-10 14:16:00');
