INSERT INTO `vision_missions` (`id`, `vision`, `mission`, `created_at`, `updated_at`) VALUES
(1, 'Our vision is to bring groundbreaking change into real-estate, transforming property ownership into a seamless, secure, and boundless opportunity for all. We envision a future where anyone no matter their background can invest, own and manage real-estate with ease. Driven by integrity, we are building a Tech-driven ecosystem where ownership isn’t just a privilege… It is a right within reach.', 'We are on a mission to democratize real estate by creating a transparent, technology-driven platform that empowers anyone to invest with ease. we break down the traditional barriers, making property investment more attainable than ever. With built-in security, real-time valuation updates, and an intuitive user-friendly experience, we are redefining how people engage with real-estate, turning aspirations into reality.', '2024-11-15 11:51:49', '2025-06-20 03:57:06');
